<script setup>



import 'bootstrap-icons/font/bootstrap-icons.css';
import iconImage from '@/assets/Icon.jpg';
import { useI18n } from 'vue-i18n';

const { t, locale } = useI18n();
const setLocale = (newLocale) => {
    locale.value = newLocale;
};





document.addEventListener('DOMContentLoaded', () => {
    const input = document.getElementById('input');
    const icon = document.getElementById('cmdIcon');
    const loading = document.getElementById('loading');
    const content = document.getElementById('content');
    const firstContainer = document.getElementById('splashScreen');
    const togglemode = document.getElementById('togglemode');

    const btnEN = document.getElementById('en');
    const btnPT = document.getElementById('pt');

    btnEN.addEventListener('click', () => {
        if (locale.value == 'en') {
            btnEN.style.display = 'block';
            btnPT.style.display = 'none';
        } else {
            btnEN.style.display = 'none';
            btnPT.style.display = 'flex';
        }
    });

    btnPT.addEventListener('click', () => {
        if (locale.value == 'pt') {
            btnPT.style.display = 'block';
            btnEN.style.display = 'none';
        } else {
            btnPT.style.display = 'none';
            btnEN.style.display = 'flex';
        }
    });


    togglemode.addEventListener('click', () => {
        const body = document.body;
        const secondSection = document.getElementById('secondSection');
        const thirdSection = document.getElementById('third');
        const nextBtn = document.querySelector('.next-btn');
        const dropdown = document.querySelector('.navbar-dropdown');
        const paragraphs = document.querySelectorAll('.XD');
        const UpText = document.querySelectorAll('.Joj');
        const project = document.getElementById('project');
        const headerContact = document.getElementById('headerC');

        if (togglemode.classList.contains('bi-brightness-high')) {
            togglemode.classList.remove('bi-brightness-high');
            togglemode.classList.add('bi-moon');
            togglemode.style.transform = 'rotate(360deg)';

            paragraphs.forEach((paragraph) => {
                paragraph.style.color = '#ffffff';
            });

            UpText.forEach((uptexts) => {
                uptexts.style.color = '#ffffff';
            })
            body.style.backgroundColor = '#333240';
            body.style.backgroundImage = `url("data:image/svg+xml,%3Csvg width='52' height='26' viewBox='0 0 52 26' xmlns='http://www.w3.org/2000/svg'%3E%3Cg fill='none' fill-rule='evenodd'%3E%3Cg fill='%238f88a1' fill-opacity='0.4'%3E%3Cpath d='M10 10c0-2.21-1.79-4-4-4-3.314 0-6-2.686-6-6h2c0 2.21 1.79 4 4 4 3.314 0 6 2.686 6 6 0 2.21 1.79 4 4 4 3.314 0 6 2.686 6 6 0 2.21 1.79 4 4 4v2c-3.314 0-6-2.686-6-6 0-2.21-1.79-4-4-4-3.314 0-6-2.686-6-6zm25.464-1.95l8.486 8.486-1.414 1.414-8.486-8.486 1.414-1.414z' /%3E%3C/g%3E%3C/g%3E%3C/svg%3E")`;
            secondSection.style.backgroundColor = '#333240';
            secondSection.style.backgroundColor = `url("data:image/svg+xml,%3Csvg width='40' height='1' viewBox='0 0 40 1' xmlns='http://www.w3.org/2000/svg'%3E%3Cpath d='M0 0h20v1H0z' fill='%238f88a1' fill-opacity='0.4' fill-rule='evenodd'/%3E%3C/svg%3E")`;
            thirdSection.style.backgroundColor = '#333240';
            nextBtn.style.color = 'white';
            dropdown.style.backgroundColor = '#333240';
            project.style.backgroundColor = '#333240';
            headerContact.style.color = 'white';

        } else {
            togglemode.classList.remove('bi-moon');
            togglemode.classList.add('bi-brightness-high');
            togglemode.style.transform = 'rotate(0deg)';

            body.style.backgroundColor = '#DFDBE5';
            body.style.backgroundImage = `url("data:image/svg+xml,%3Csvg width='52' height='26' viewBox='0 0 52 26' xmlns='http://www.w3.org/2000/svg'%3E%3Cg fill='none' fill-rule='evenodd'%3E%3Cg fill='%239C92AC' fill-opacity='0.4'%3E%3Cpath d='M10 10c0-2.21-1.79-4-4-4-3.314 0-6-2.686-6-6h2c0 2.21 1.79 4 4 4 3.314 0 6 2.686 6 6 0 2.21 1.79 4 4 4 3.314 0 6 2.686 6 6 0 2.21 1.79 4 4 4v2c-3.314 0-6-2.686-6-6 0-2.21-1.79-4-4-4-3.314 0-6-2.686-6-6zm25.464-1.95l8.486 8.486-1.414 1.414-8.486-8.486 1.414-1.414z' /%3E%3C/g%3E%3C/g%3E%3C/svg%3E")`;

            headerContact.style.color = '#444444';
            paragraphs.forEach((paragraph) => {
                paragraph.style.color = '#444444';  // Altera a cor de cada parágrafo
            });

            UpText.forEach((uptexts) => {
                uptexts.style.color = '#000000';
            })

            project.style.backgroundColor = '#b9abab';
            thirdSection.style.backgroundColor = '#DFDBE5';
            secondSection.style.backgroundColor = '#dfdbe5';
            secondSection.style.backgroundColor = `url("data:image/svg+xml,%3Csvg width='40' height='1' viewBox='0 0 40 1' xmlns='http://www.w3.org/2000/svg'%3E%3Cpath d='M0 0h20v1H0z' fill='%239C92AC' fill-opacity='0.4' fill-rule='evenodd'/%3E%3C/svg%3E")`;
            dropdown.style.backgroundColor = '#dfdbe5';
            nextBtn.style.color = '#444444';
        }
    });



    const nextBtn = document.querySelector('.next-btn');

    nextBtn.addEventListener('click', () => {
        const secondSection = document.querySelector('.second-section');
        secondSection.scrollIntoView({ behavior: 'smooth' });
    });


    input.addEventListener('keyup', () => {
        if (input.value.trim() !== '') {
            icon.classList.remove('bi-terminal');
            icon.classList.add('bi-terminal-fill');
        } else {
            icon.classList.remove('bi-terminal-fill');
            icon.classList.add('bi-terminal');
        }
    });

    input.addEventListener('keyup', (e) => {
        const body = document.body;

        if (e.key === 'Enter') {
            if (input.value.trim() === 'Start' || input.value.trim() === 'start') {
                // Exibe a animação de carregamento
                loading.style.display = 'block';
                content.style.visibility = 'hidden';
                content.style.opacity = 0;
                firstContainer.style.display = 'none'; // Esconde o campo de entrada
                content.style.display = 'none'; // Esconde o conteúdo real

                // Simula um atraso para a animação de carregamento (ex: 3 segundos)
                setTimeout(() => {
                    // Esconde a animação de carregamento e exibe o conteúdo
                    loading.style.display = 'none';
                    content.style.visibility = 'visible';
                    content.style.opacity = 1;
                    content.style.display = 'block';
                    body.style.backgroundColor = '#DFDBE5';
                    body.style.backgroundImage = `url("data:image/svg+xml,%3Csvg width='52' height='26' viewBox='0 0 52 26' xmlns='http://www.w3.org/2000/svg'%3E%3Cg fill='none' fill-rule='evenodd'%3E%3Cg fill='%239C92AC' fill-opacity='0.4'%3E%3Cpath d='M10 10c0-2.21-1.79-4-4-4-3.314 0-6-2.686-6-6h2c0 2.21 1.79 4 4 4 3.314 0 6 2.686 6 6 0 2.21 1.79 4 4 4 3.314 0 6 2.686 6 6 0 2.21 1.79 4 4 4v2c-3.314 0-6-2.686-6-6 0-2.21-1.79-4-4-4-3.314 0-6-2.686-6-6zm25.464-1.95l8.486 8.486-1.414 1.414-8.486-8.486 1.414-1.414z' /%3E%3C/g%3E%3C/g%3E%3C/svg%3E")`;
                }, 3000); // Atraso de 3 segundos para mostrar o conteúdo
            } else {
                // Seleciona o cmd-container
                const cmdContainer = document.querySelector('.cmd-container');
                const cmdIcon = document.querySelector('.cmd-label');
                const cmdInpust = document.querySelector('.cmd-input');
                const cmdTerm = document.querySelector('.txt-container');

                // Adiciona a classe de erro para ativar a animação
                cmdContainer.classList.add('error-animation');
                cmdIcon.classList.add('error-red');
                cmdInpust.classList.add('error-red');
                cmdTerm.classList.add('error-animation');

                // Remove a classe de erro após a animação terminar
                setTimeout(() => {
                    cmdContainer.classList.remove('error-animation');
                    cmdIcon.classList.remove('error-red');
                    cmdInpust.classList.remove('error-red');
                    cmdTerm.classList.remove('error-animation');
                }, 1000); // Tempo correspondente à duração da animação
            }
        }
    });




    const scrollElements = document.querySelectorAll('.scroll');

    const observer = new IntersectionObserver(
        (entries) => {
            entries.forEach((entry) => {
                if (entry.isIntersecting) {
                    // Quando o elemento entra na viewport
                    entry.target.classList.add('in-view'); // Adiciona a classe de animação de entrada
                    entry.target.classList.remove('scroll-animation'); // Remove a classe de animação de saída
                } else {
                    // Quando o elemento sai da viewport
                    entry.target.classList.add('scroll-animation'); // Adiciona a classe de animação de saída
                    entry.target.classList.remove('in-view'); // Remove a classe de animação de entrada
                }
            });
        },
        {
            threshold: 0.5, // Define o ponto em que a animação deve ser ativada (50% visível)
        }
    );

    scrollElements.forEach((element) => {
        observer.observe(element); // Observa cada elemento com a classe .scroll
    });

    const btnDropdown = document.querySelector('.btn-dropdown');
    const navbarDropdown = document.querySelector('.navbar-dropdown');

    btnDropdown.addEventListener('click', () => {
        navbarDropdown.classList.toggle('active');
        btnDropdown.classList.toggle('active');

        // Alternar entre o ícone de lista e o ícone "X"
        if (btnDropdown.classList.contains('active')) {
            btnDropdown.classList.remove('bi-list');
            btnDropdown.classList.add('bi-x');
        } else {
            btnDropdown.classList.remove('bi-x');
            btnDropdown.classList.add('bi-list');
        }
    });
});



</script>




